from Cryptodome.Util.number import *

flag = bytes_to_long(b"nest{<REDACTED>}")

p = getPrime(555)
q = getPrime(555)

public_key = p*q

problem = pow((p+q), 2) * pow((p-q), 2)
encrypted = pow(flag, 65537, public_key)

print('Public Key =', public_key)
print('Problem =', problem)
print('Encrypted =', encrypted)

